def calculate_d(p, q, e):
    n = p * q
    phi = (p - 1) * (q - 1)
    gcd, x, y = extended_euclidean_algorithm(e, phi)

    if gcd != 1:
        raise ValueError("e is not invertible.")

    d = x % phi
    return d

def extended_euclidean_algorithm(a, b):
    if b == 0:
        return (a, 1, 0)
    else:
        gcd, x, y = extended_euclidean_algorithm(b, a % b)
        return (gcd, y, x - (a // b) * y)

